import React from "react";
import ReactDOM from "react-dom";
import "Button.css";

const Button = (props) => {
  return (
    <div>
      <button
        class="button"
        style={{ width: props.width, height: props.height }}
      >
        hello
      </button>
    </div>
  );
};

export default Button;
